body:
Pass also non-string values as Dispatch API and Dispatch Delegate options

As an example, in order to specify "/data/local/tmp/" as the directory from where to load shared library=ies, the user can set up dispatch delegate options as shown below:

auto dispatch_delegate_options = litert::CreateDispatchDelegateOptionsPtr();
LiteRtAddDispatchDelegateOption(dispatch_delegate_options.get(), 
   LiteRtDispatchOption{
      .name = kDispatchOptionSharedLibraryDir,
      .value = LiteRtAny {
         .type = kLiteRtAnyTypeString,
         .str_value = "/data/local/tmp/",
      },
});
ASSERT_EQ(
    LiteRtAddDispatchDelegateExecInfoOption(
dispatch_delegate_options.get(), "npu_bytecode", npu_model->data(),
npu_model->size(), /*function_name=*/"simple"),
kTfLiteOk);
    auto dispatch_delegate =
litert::CreateDispatchDelegatePtr(std::move(dispatch_delegate_options));
